import React, { lazy } from 'react';
import Home from './Books/Accounts/LoginPage/LoginPage'

const routes = [
  {
    path: '/auth/login',
    exact: true,
    component: () => <Home />
  },
  {
    path: '/auth/signup',
    exact: true,
    component: () => <Home />
  },
];

export default routes;
